import Topo from "./componentes/Topo";
import EspacoBotoes from "./componentes/EspacoBotoes";
import EspacoJogos from "./componentes/EspacoJogos";
import {BrowserRouter, Routes, Route} from 'react-router-dom';

function App() {

  return (
    <div className="App">
      <Topo/>
      <BrowserRouter>
      <EspacoBotoes />
        <Routes>
          <Route path='/' />
          <Route path="nao-nomeado" element={<EspacoJogos/>}/>
          <Route path="dash-and-get-out" element={<EspacoJogos/>}/>
          <Route path="square-problems" element={<EspacoJogos/>}/>
          <Route path="pech" element={<EspacoJogos/>}/>
          <Route path="save-vein" element={<EspacoJogos/>}/>
          <Route path="lights-come-back" element={<EspacoJogos/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
